Big news for workers! 💪 

@SEIU and @AFLCIO are joining forces, creating a powerful movement nearly 15M strong. 

Together, we’re going to fight for fair pay, better benefits, and more worker power!

A medical emergency shouldn’t ruin anyone’s financial future.

@CFPB just finalized a rule removing $49B in medical debt from credit reports, giving millions of Americans a fresh start &amp; stopping predatory debt collection practices.

A big win for fairness &amp; financial freedom!

Israel has the right to defend itself, but these US weapons shouldn't be used to fuel atrocities in Gaza.

@SenSanders' resolutions would uphold human rights, protect innocent lives + not impact Israel's defenses.

I would vote for these resolutions if given the opportunity.
